using namespace std;

vector<int> sort_array(vector<int> array) {
    // Base case handling
    if (array.empty() || array.size() == 1) {
        return array;
    }

    // Determine sorting order based on sum of first and last elements
    bool is_odd = (array[0] + array.back()) % 2 != 0;

    // Create a copy of the array to avoid modifying the original one
    vector<int> sorted_array(array);

    if (is_odd) {
        sort(sorted_array.begin(), sorted_array.end());
    } else {
        sort(sorted_array.rbegin(), sorted_array.rend());
    }

    return sorted_array;
}

