#include <vector>
#include <unordered_map>
#include <algorithm>
using namespace std;

int search(vector<int> lst) {
    unordered_map<int, int> frequency;

    // Counting frequencies of each number in the list.
    for (int num : lst) {
        frequency[num]++;
    }

    int max_val = -1;

    // Checking if any number's frequency is greater than or equal to its value
    for (const auto& entry : frequency) {
        if (entry.first <= entry.second) {
            max_val = max(max_val, entry.first);
        }
    }

    return max_val;
}

#undef NDEBUG
#include<assert.h>
int main(){
