    if (!a_is_integer || !b_is_integer || !c_is_integer) {
        return false;
    }

    // Check if one of the numbers equals the sum of the other two
    if (a == b + c || b == a + c || c == a + b) {
        return true;
    } else {
        return false;
    }
}

