int factorial(int num) {
    int result = 1;
    for (int i = 2; i <= num; ++i) {
        result *= i;
    }
    return result;
}

vector<int> f(int n) {
    vector<int> result(n);
    for (int i = 1; i <= n; ++i) {
        if (i % 2 == 0) {
            result[i - 1] = factorial(i); // Adjust index to match C++ zero-based indexing
        } else {
            int sum = (i * (i + 1)) / 2; // Sum of numbers from 1 to i using arithmetic series formula
            result[i - 1] = sum;
        }
    }
    return result;
}

