string change_base(int x, int base) {
    if (x == 0) return "0";

    vector<int> digits;
    while (x > 0) {
        digits.push_back(x % base);
        x /= base;
    }

    string result = "";
    for (int i = digits.size() - 1; i >= 0; --i) {
        result += to_string(digits[i]);
    }

    return result;
}

