using namespace std;

string encode_cyclic(string s) {
    // returns encoded string by cycling groups of three characters.
    int l = s.length();
    int num_groups = (l + 2) / 3;
    string output = "";

    for (int i = 0; i * 3 < l; i++) {
        // Extract substring of length up to 3
        string x = s.substr(i * 3, 3);

        if (x.length() == 3) {
            // Rotate the group by moving the first character to the end
            x = x.substr(1) + x[0];
        }

        output += x;
    }

    return output;
}

string decode_cyclic(string s) {
    /*
    takes as input string encoded with encode_cyclic function. Returns decoded string.
    */
    int l = s.length();
    int num_groups = (l + 2) / 3;
    string output = "";

    for (int i = 0; i * 3 < l; i++) {
        // Extract substring of length up to 3
        string x = s.substr(i * 3, 3);

        if (x.length() == 3) {
            // Rotate the group by moving the last character to the front
            x = x[x.length() - 1] + x.substr(0, x.length() - 1);
        }

        output += x;
    }

    return output;
}

