string encode(string message) {
    string vowels = "aeiouAEIOU";
    string encoded_message = "";

    for (char& c : message) {
        char encoded_char;

        // Check if the character is a vowel and replace it
        size_t pos = vowels.find(c);
        if (pos != string::npos) {
            // Determine replacement based on position in vowels string
            if (c >= 'a' && c <= 'u') {  // lowercase
                encoded_char = c + 2;
            } else if (c >= 'A' && c <= 'U') {  // uppercase
                encoded_char = c + 2;
            }
        } else {
            encoded_char = c;  // Not a vowel, keep the character as is
        }

        // Swap case of the character
        if (islower(encoded_char)) {
            encoded_char = toupper(encoded_char);
        } else if (isupper(encoded_char)) {
            encoded_char = tolower(encoded_char);
        }

        encoded_message += encoded_char;
    }

    return encoded_message;
}

