float mean_absolute_deviation(vector<float> numbers) {
    float n = numbers.size();
    float sum = accumulate(numbers.begin(), numbers.end(), 0.0);
    float mean_value = sum / n;

    float total_abs_diff = 0.0;
    for (auto x : numbers) {
        total_abs_diff += std::abs(x - mean_value);
    }

    return total_abs_diff / n;
}

