int fruit_distribution(string s, int n) {
    stringstream ss(s);
    string word;
    int apples = 0, oranges = 0;

    // Extracting numbers from the string using stringstream and parsing integers
    while (ss >> word) {
        if (word == "apples" || word == "oranges") {
            ss >> word; // Skip "and"
            continue;
        }

        int num;
        stringstream convert(word);
        if (!(convert >> num)) { 
            continue;  // If conversion fails, skip
        }

        if (ss.peek() == 'a') { // Check next character to determine fruit type
            apples = num;
        } else {
            oranges = num;
        }
    }

    // Calculating mangoes by subtracting apples and oranges from total fruits
    int mango_count = n - (apples + oranges);
    return mango_count;
}

