    string delimiter_space = " ";
    while ((pos = txt.find(delimiter_space)) != string::npos) {
        result.push_back(txt.substr(0, pos));
        txt.erase(0, pos + delimiter_space.length());
    }

    // If there are no spaces left but commas exist, split on them.
    if (result.empty()) {
        size_t comma_pos = 0;
        string delimiter_comma = ",";
        while ((comma_pos = txt.find(delimiter_comma)) != string::npos) {
            result.push_back(txt.substr(0, comma_pos));
            txt.erase(0, comma_pos + delimiter_comma.length());
        }
    }

    // If there are no spaces or commas, count the lowercase letters with odd order positions.
    if (result.empty()) {
        int count = 0;
        for (char c : txt) {
            if (islower(c) && ((c - 'a') % 2 == 1)) {
                ++count;
            }
        }
        result.push_back(to_string(count));
    }

    // Add the remaining part of the string to the result.
    if (!txt.empty()) {
        result.push_back(txt);
    }

    return result;
}

