int do_algebra(vector<string> operators, vector<int> operands) {
    int result = operands[0];

    for (size_t i = 0; i < operators.size(); ++i) {
        if (operators[i] == "+") {
            result += operands[i + 1];
        } else if (operators[i] == "-") {
            result -= operands[i + 1];
        } else if (operators[i] == "*") {
            result *= operands[i + 1];
        } else if (operators[i] == "//") {
            result /= operands[i + 1]; // Floor division in C++
        } else if (operators[i] == "**") {
            result = pow(result, operands[i + 1]);
        }
    }

    return result;
}

