int do_algebra(vector<string> operators, vector<int> operands) {
    string expression = to_string(operands[0]);

    for (size_t i = 0; i < operators.size(); ++i) {
        const string& operator_str = operators[i];
        int operand = operands[i + 1];

        if (operator_str == "//") {
            expression += " / ";
        } else if (operator_str == "**") {
            expression += " pow(";
            expression += to_string(operand);
            expression += ", ";
            expression += to_string(operands[i]);
            expression += ") ";
        } else {
            expression += operator_str + " ";
            expression += to_string(operand) + " ";
        }
    }

    // Evaluate the expression using a simple parser
    int result = operands[0];
    for (size_t i = 0; i < operators.size(); ++i) {
        const string& op = operators[i];
        if (op == "+") {
            result += operands[i + 1];
        } else if (op == "-") {
            result -= operands[i + 1];
        } else if (op == "*") {
            result *= operands[i + 1];
        } else if (op == "//") {
            result /= operands[i + 1];
        } else if (op == "**") {
            result = pow(result, operands[i + 1]);
        }
    }

    return result;
}

