vector<string> total_match(vector<string> lst1, vector<string> lst2) {
    // Calculate the total number of characters in each list
    int count_lst1 = 0;
    for (const string& s : lst1) {
        count_lst1 += s.length();
    }

    int count_lst2 = 0;
    for (const string& s : lst2) {
        count_lst2 += s.length();
    }

    // Compare and return the appropriate list based on character counts
    if (count_lst1 <= count_lst2) {
        return lst1;
    } else {
        return lst2;
    }
}

