// Function to check if a number is prime
bool is_prime(int n) {
    if (n <= 1)
        return false;
    for (int i = 2; i * i <= n; ++i) {
        if (n % i == 0)
            return false;
    }
    return true;
}

// Function to determine whether the length of intersection is a prime number
string intersection(vector<int> interval1, vector<int> interval2) {
    int start_max = max(interval1[0], interval2[0]);
    int end_min = min(interval1[1], interval2[1]);

    // Check if there's an overlap between the intervals
    if (start_max > end_min)
        return "NO";

    // Calculate the length of intersection
    int length_of_intersection = end_min - start_max + 1;

    // Check if the length is a prime number
    if (is_prime(length_of_intersection))
        return "YES";
    else
        return "NO";
}


