vector<int> tri(int n) {
    if (n == 0) {
        return {1};
    } else if (n == 1) {
        return {1, 3};
    }

    vector<int> result = {1, 3};

    for (int i = 2; i <= n; ++i) {
        if (i % 2 == 0) {
            result.push_back(1 + i / 2);
        } else {
            int next_val = result[i - 1] + result[i - 2] + (1 + (i + 1) / 2);
            result.push_back(next_val);
        }
    }

    return result;
}

