vector<int> tri(int n) {
    vector<int> result(n + 1);

    // Base cases
    if (n >= 0) result[0] = 1;
    if (n >= 1) result[1] = 3;

    for (int i = 2; i <= n; ++i) {
        if (i % 2 == 0) {
            // If even
            result[i] = 1 + i / 2;
        } else {
            // If odd, calculate based on the previous values and an assumed base case for tri(-1)
            int next_val = result[i - 1] + result[i - 2];
            if (i > 2) {
                next_val += result[i - 3];  // Use the value from three steps back
            } else {
                next_val += 1;              // Assume tri(-1) is 1 for base case
            }
            result[i] = next_val;
        }
    }

    return result;
}

