int fib4(int n) {
    if (n < 0) return -1; // Assuming a negative input is invalid and returning -1 as an error indicator.

    // Base cases
    if (n == 0 || n == 1 || n == 3) return 0;
    else if (n == 2) return 2;

    // Initialize the first four values of the sequence
    vector<int> fib_values = {0, 0, 2, 0};

    // Compute the nth element iteratively
    for (int i = 4; i <= n; ++i) {
        int next_value = fib_values[i-1] + fib_values[i-2] + fib_values[i-3] + fib_values[i-4];
        fib_values.push_back(next_value);
    }

    return fib_values[n];
}

