int count_nums(vector<int> n) {
    int count = 0;
    for (auto num : n) {
        int sum = 0, temp = abs(num);
        while (temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }
        if ((num < 0 && sum - 2 * (abs(num) % 10) > 0) || (num >= 0 && sum > 0)) {
            ++count;
        }
    }
    return count;
}

