int sum_of_digits(int num) {
    int sum = 0;
    bool is_negative = num < 0;
    while (num != 0) {
        int digit = num % 10;
        if (!(is_negative && digit == 0)) { // Avoid counting '-' as a digit
            sum += digit;
        }
        num /= 10;
    }
    return is_negative ? -sum : sum; 
}

int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (sum_of_digits(num) > 0) {
            ++count;
        }
    }
    return count;
}

