// Helper function to calculate the sum of digits considering the sign.
int sum_of_digits(int num) {
    int sum = 0;
    bool is_negative = num < 0;
    while (num != 0) {
        int digit = num % 10;
        sum += digit;
        num /= 10;
    }
    if (is_negative && sum != 0)
        sum -= 2 * (sum % 10); // Adjusting the first signed digit.
    return sum;
}

int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (sum_of_digits(num) > 0) {
