#include <string>
using namespace std;

bool correct_bracketing(string brackets) {
    int balance = 0;
    for (char& c : brackets) {
        if (c == '(') {
            ++balance;
        } else if (c == ')') {
            --balance;
        }
        if (balance < 0) {
            return false; // More closing brackets than opening ones
        }
    }
    return balance == 0; // All brackets are correctly matched
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (correct_bracketing("()"));
    assert (correct_bracketing("(()())"));
    assert (correct_bracketing("()()(()())()"));
    assert (correct_bracketing("()()((()()())())(()()(()))"));
    assert (not (correct_bracketing("((()())))")));
    assert (not (correct_bracketing(")(()")));
    assert (not (correct_bracketing("(")));
    assert (not (correct_bracketing("((((")));
    assert (not (correct_bracketing(")")));
    assert (not (correct_bracketing("(()")));
    assert (not (correct_bracketing("()()(()())())(()")));
    assert (not (correct_bracketing("()()(()())()))()")));
}

