// Function to convert string with comma or dot decimal separator to float
float str_to_float(const string& s) {
    string temp = s;
    replace(temp.begin(), temp.end(), ',', '.');
    return stof(temp);
}

// Main comparison function using boost::any for handling different types
boost::any compare_one(boost::any a, boost::any b) {
    float a_val, b_val;

    // Convert any to string and then to float if necessary
    try {
        a_val = boost::any_cast<int>(a);
    } catch (const boost::bad_any_cast&) {  // Corrected namespace here
        try {
            a_val = boost::any_cast<float>(a);
        } catch (const boost::bad_any_cast&) {  // And here
            a_val = str_to_float(boost::any_cast<string>(a));
        }
    }

    try {
        b_val = boost::any_cast<int>(b);
    } catch (const boost::bad_any_cast&) {  // Corrected namespace here
        try {
            b_val = boost::any_cast<float>(b);
        } catch (const boost::bad_any_cast&) {  // And here
            b_val = str_to_float(boost::any_cast<string>(b));
        }
    }

    // Compare the values
    if (a_val > b_val) {
        return a;
    } else if (b_val > a_val) {
        return b;
    } else {
        return string("None");
    }
}

