// Function to convert a string with either '.' or ',' as the decimal separator into a float.
float parse_float(const string& str) {
    string temp = str;
    replace(temp.begin(), temp.end(), ',', '.');
    return stof(temp);
}

// Main comparison function
boost::any compare_one(boost::any a, boost::any b) {
    // Convert both inputs to strings for uniform processing.
    std::string a_str = boost::any_cast<std::string>(a);
    if (a_str.empty()) {
        try {
            int a_int = boost::any_cast<int>(a);
            a_str = std::to_string(a_int);
        } catch (...) {}

        try {
            float a_float = boost::any_cast<float>(a);
            a_str = std::to_string(a_float);
        } catch (...) {}
    }

    std::string b_str = boost::any_cast<std::string>(b);
    if (b_str.empty()) {
        try {
            int b_int = boost::any_cast<int>(b);
            b_str = std::to_string(b_int);
        } catch (...) {}

        try {
            float b_float = boost::any_cast<float>(b);
            b_str = std::to_string(b_float);
        } catch (...) {}
    }

    // Parse the strings to floats for comparison.
    float a_val = parse_float(a_str);
    float b_val = parse_float(b_str);

    if (a_val == b_val) {
        return "None";
    }

    if (a_val > b_val) {
        try {
            int a_int = boost::any_cast<int>(a);
            return a;
        } catch (...) {}

        try {
            float a_float = boost::any_cast<float>(a);
            return a;
        } catch (...) {}

        return a_str; // Return the original string if it was passed as input.
    }

    try {
        int b_int = boost::any_cast<int>(b);
        return b;
    } catch (...) {}

    try {
        float b_float = boost::any_cast<float>(b);
        return b;
    } catch (...) {}

    return b_str; // Return the original string if it was passed as input.
}


