vector<string> separate_paren_groups(string paren_string) {
    string cleanedString = "";
    for (char c : paren_string) {
        if (!isspace(c)) {
            cleanedString += c;
        }
    }

    vector<string> result;
    int balance = 0;
    size_t start_index = 0;

    for (size_t i = 0; i < cleanedString.length(); ++i) {
        char c = cleanedString[i];
        if (c == '(') {
            if (balance == 0) {
                start_index = i;
            }
            balance++;
        } else if (c == ')') {
            balance--;
            if (balance == 0) {
                result.push_back(cleanedString.substr(start_index, i - start_index + 1));
            }
        }
    }

    return result;
}

