double poly(const std::vector<double>& xs, double x) {
    /*
    Evaluates polynomial with coefficients xs at point x.
    Returns xs[0] + xs[1] * x + xs[2] * x^2 + .... + xs[n] * x^n
    */
    double sum = 0;
    for (size_t i = 0; i < xs.size(); ++i) {
        sum += xs[i] * std::pow(x, i);
    }
    return sum;
}

double find_zero(const std::vector<double>& xs) {
    /*
    xs are coefficients of a polynomial. find_zero finds x such that poly(x) = 0.
    find_zero returns only one zero point, even if there are many.
    Moreover, find_zero only takes list xs having even number of coefficients and largest non-zero coefficient as it guarantees a solution.

    >>> round(find_zero({1, 2}), 2); // f(x) = 1 + 2x
    -0.5 
    >>> round(find_zero({-6, 11, -6, 1}), 2); // (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3
    1.0
    */

    double a = -100; // Initial lower bound for the root search
    double b = 100;  // Initial upper bound for the root search

    if (poly(xs, a) * poly(xs, b) > 0) {
        std::cerr << "The initial bounds do not bracket a root." << std::endl;
        return NAN;
    }

    while ((b - a) / 2.0 > 1e-6) { // Tolerance for the root
        double c = (a + b) / 2.0;   // Midpoint

        if (poly(xs, c) == 0 || std::abs(b - a) < 1e-6) {
            return c;
        } else if (poly(xs, a) * poly(xs, c) < 0) {
            b = c;
        } else {
            a = c;
        }
    }

    return (a + b) / 2.0; // Return the midpoint as the approximate root
}


#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

