double poly(vector<double> xs, double x) {
    /* 
    Evaluates polynomial with coefficients xs at point x. return xs[0] + xs[1] * x + xs[2] * x^2 + .... xs[n] * x^n 
    */
    double sum = 0;
    for (size_t i = 0; i < xs.size(); ++i) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double find_zero(vector<double> xs) {
    /*
    xs are coefficients of a polynomial. find_zero finds x such that poly(x) = 0. find_zero returns only one zero point, even if there are many.
    Moreover, find_zero only takes list xs having an even number of coefficients and the largest non-zero coefficient as it guarantees a solution.
    */

    double lower_bound = -100;
    double upper_bound = 100;

    // Check for sign change in the interval
    if (poly(xs, lower_bound) * poly(xs, upper_bound) > 0) {
        throw std::runtime_error("No guaranteed root within [-100, 100]");
    }

    // Bisection method to find a zero point
    double tol = 1e-6; // Tolerance for the bisection method
    while (upper_bound - lower_bound > tol) {
        double mid = (lower_bound + upper_bound) / 2;
        if (poly(xs, mid) == 0 || abs(poly(xs, mid)) < tol) {
            return mid;
        } else if (poly(xs, lower_bound) * poly(xs, mid) < 0) {
            upper_bound = mid;
        } else {
            lower_bound = mid;
        }
    }

    // Return the midpoint of the final interval
    return (lower_bound + upper_bound) / 2;
}

