// Simple bisection method to find a root
double find_zero(vector<double> xs) {
    if (xs.size() % 2 != 0 || xs.back() == 0) {
        throw std::invalid_argument("Invalid input");
    }

    double a = -1000, b = 1000;
    double fa = poly(xs, a), fb = poly(xs, b);

    if (fa * fb > 0)
        throw std::runtime_error("No root found in the interval");

    while ((b - a) / 2.0 > 1e-6) {
        double c = (a + b) / 2;
        double fc = poly(xs, c);

        if (fc == 0 || (b - a) / 2.0 < 1e-6)
            return c;

        if (fa * fc < 0)
            b = c;
        else
            a = c, fa = fc;
    }
    return (a + b) / 2;
}

