bool is_palindrome(string str) {
    string reversed_str = str;
    reverse(reversed_str.begin(), reversed_str.end());
    return str == reversed_str;
}

string make_palindrome(string str) {
    if (str.length() == 0) {
        return "";
    }

    for (size_t i = 0; i < str.length(); ++i) {
        string suffix = str.substr(i);
        if (is_palindrome(suffix)) {
            string prefix_to_reverse = str.substr(0, i);
            reverse(prefix_to_reverse.begin(), prefix_to_reverse.end());
            return str + prefix_to_reverse;
        }
    }

    // This case should not happen as the whole string itself would be a palindrome when i=0
    string reversed_str = str;
    reverse(reversed_str.begin(), reversed_str.end());
    return str + reversed_str;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

