int choose_num(int x, int y) {
    if (x > y) {
        return -1;
    }
    // Start from y and go down until we find an even number or reach below x
    for (int num = y; num >= x; --num) {
        if (num % 2 == 0) {
            return num;
        }
    }
    return -1;
}

