using namespace std;

string encrypt(string s) {
    string encrypted_str = "";
    int shift = 4; // two multiplied by two places

    for (char &c : s) {
        if (isalpha(c)) {
            char base = islower(c) ? 'a' : 'A';
            c = ((c - base + shift) % 26) + base;
        }
        encrypted_str += c;
    }

    return encrypted_str;
}

