using namespace std;

string encrypt(string s) {
    string encrypted_str = "";
    for (char& c : s) {
        if ('a' <= c && c <= 'z') {
            char new_char = ((c - 'a' + 4) % 26) + 'a';
            encrypted_str += new_char;
        } else {
            encrypted_str += c;
        }
    }
    return encrypted_str;
}

