using namespace std;

bool is_sorted(vector<int> lst) {
    if (lst.size() <= 1) return true;

    vector<int> count(256, 0); // Assuming a reasonable upper bound for integers in the list.

    for(int i = 0; i < lst.size(); ++i){
        int num = lst[i];

        // Check if current number is less than previous one
        if(i > 0 && num < lst[i - 1]) return false;

        // Count occurrences of each number
        count[num]++;

        // If any number appears more than twice, return false
        if(count[num] > 2) return false;
    }

    return true;
}

