    int smallest = INT_MAX;
    int second_smallest = INT_MAX;

    for (int num : lst) {
        if (num < smallest) {
            second_smallest = smallest;
            smallest = num;
        } else if (num != smallest && num < second_smallest) {
            second_smallest = num;
        }
    }

    return (second_smallest == INT_MAX) ? -1 : second_smallest;
}

