bool custom_compare(const string& a, const string& b) {
    if (a.length() == b.length()) {
        return a < b; // Alphabetical order for same length
    }
    return a.length() < b.length(); // Ascending by length
}

vector<string> sorted_list_sum(vector<string> lst){
    vector<string> filtered_list;

    // Filter out strings with odd lengths.
    for (const string& word : lst) {
        if (word.length() % 2 == 0) {
            filtered_list.push_back(word);
        }
    }

    // Sort the list by length and then alphabetically
    sort(filtered_list.begin(), filtered_list.end(), custom_compare);

    return filtered_list;
}

