vector<string> sorted_list_sum(vector<string> lst) {
    vector<string> filtered_lst;

    // Filter out strings with odd lengths
    for (const auto& s : lst) {
        if (s.length() % 2 == 0) {
            filtered_lst.push_back(s);
        }
    }

    // Sort by length, and then alphabetically if lengths are the same
    sort(filtered_lst.begin(), filtered_lst.end(),
         [](const string &a, const string &b) {
             return a.size() != b.size() ? a.size() < b.size() : a < b;
         });

    return filtered_lst;
}

