// Function to perform modular exponentiation
int modp(int n, int p) {
    long long result = 1;
    long long base = 2;

    while (n > 0) {
        if (n % 2 == 1) { // If n is odd, multiply the result by the current base value
            result = (result * base) % p;
        }
        base = (base * base) % p; // Square the base and take modulo p to prevent overflow
        n /= 2; // Divide n by 2 for the next iteration
    }

    return static_cast<int>(result);
}


