// Function to calculate (base^exponent) % mod using iterative method to avoid overflow.
int powerMod(int base, int exponent, int mod) {
    long long result = 1;
    long long current_base = base % mod; // Ensure the base is within the modulo range.

    while (exponent > 0) {
        if (exponent & 1) { // If exponent is odd, multiply the result by the current base.
            result = (result * current_base) % mod;
        }
        exponent >>= 1; // Divide exponent by 2.
        current_base = (current_base * current_base) % mod; // Square the base and take modulo.
    }

    return static_cast<int>(result);
}

int modp(int n, int p) {
    return powerMod(2, n, p);
}

