string anti_shuffle(string s) {
    string result = "";
    string word = "";

    for (char c : s) {
        if (c == ' ') {
            // Sort the current word and append to result
            sort(word.begin(), word.end());
            result += word + " ";
            word = "";  // Reset word for next iteration
        } else {
            word += c;
        }
    }

    // Handle the last word in the string
    if (!word.empty()) {
        sort(word.begin(), word.end());
        result += word;
    }

    return result;
}

