vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<pair<int, int>> directions{{0, 1}, {1, 0}, {-1, 0}, {0, -1}};

    function<vector<int>(int, int, vector<int>)> dfs;
    dfs = [&] (int x, int y, vector<int> path) -> vector<int> {
        if (path.size() == k)
            return path;

        vector<int> min_path(k, INT_MAX);
        for (auto& dir : directions) {
            int dx = dir.first, dy = dir.second;
            int nx = x + dx, ny = y + dy;
            if (0 <= nx && nx < n && 0 <= ny && ny < n) {
                auto new_path = dfs(nx, ny, path);
                new_path.push_back(grid[nx][ny]);

                if (new_path.size() == k && (min_path.empty() || new_path < min_path))
                    min_path = new_path;
            }
        }

        return min_path;
    };

    vector<int> result(k, INT_MAX);
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            auto path = dfs(i, j, {grid[i][j]});

            if (path.size() == k && (result.empty() || path < result))
                result = path;
        }
    }

    return result;
}

