vector<int> minPath(vector<vector<int>> grid, int k) {
    int N = grid.size();

    vector<int> dfs(int x, int y, vector<int>& path) {
        if (path.size() == k)
            return path;

        vector<int> best_path;

        for (auto [dx, dy] : vector<pair<int,int>>{{-1, 0}, {1, 0}, {0, -1}, {0, 1}}) {
            int nx = x + dx, ny = y + dy;
            if (nx >= 0 && nx < N && ny >= 0 && ny < N) {
                path.push_back(grid[nx][ny]);
                vector<int> new_path = dfs(nx, ny, path);
                if (best_path.empty() || (!new_path.empty() && new_path < best_path))
                    best_path = new_path;
                path.pop_back();
            }
        }

        return best_path;
    }

    vector<int> min_path;

    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            vector<int> current_path{grid[i][j]};
            vector<int> new_min_path = dfs(i, j, current_path);
            if (min_path.empty() || (!new_min_path.empty() && new_min_path < min_path))
                min_path = new_min_path;
        }
    }

    return min_path;
}

