string circular_shift(int x, int shift) {
    string digits = to_string(x);
    int num_digits = digits.size();

    if (shift >= num_digits) {
        reverse(digits.begin(), digits.end());
        return digits;
    }

    int actual_shift = shift % num_digits;  // To handle shifts larger than the number of digits
    rotate(digits.rbegin(), digits.rbegin() + actual_shift, digits.rend());
    return digits;
}

