#include <vector>
#include <sstream>
using namespace std;

int is_bored(string S) {
    vector<string> sentences;
    stringstream ss(S);
    string token, sentence;

    // Split the input string into sentences based on delimiters '.', '?' and '!'
    while (getline(ss, token, '.')) {
        if (!token.empty()) sentences.push_back(token);
        getline(ss, token, '?');
        if (!token.empty()) sentences.push_back(token);
        getline(ss, token, '!');
        if (!token.empty()) sentences.push_back(token);
    }

    int boredom_count = 0;

    // Check each sentence for the condition of starting with "I"
    for (const auto& s : sentences) {
        stringstream ss(s);
        string word;
        ss >> word; // Extract the first word
        if (word == "I") {
            boredom_count++;
        }
    }

    return boredom_count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_bored("Hello world") == 0);
    assert (is_bored("Is the sky blue?") == 0);
    assert (is_bored("I love It !") == 1);
    assert (is_bored("bIt") == 0);
    assert (is_bored("I feel good today. I will be productive. will kill It") == 2);
    assert (is_bored("You and I are going for a walk") == 0);
}

