bool starts_with_i(const string& sentence) {
    // Trim leading spaces
    size_t start = sentence.find_first_not_of(" \t");
    if (start == string::npos || sentence.substr(start, 1) != "I") return false;
    // Check for space or end of sentence after 'I'
    size_t next_char_pos = start + 1;
    return next_char_pos == sentence.size() || sentence[next_char_pos] == ' ';
}

int is_bored(string S) {
    int boredom_count = 0;
    string delimiter = "?.!";
    stringstream ss(S);
    string token;

    while (getline(ss, token, '.')) {
        for (char c : delimiter) {
            size_t pos;
            while ((pos = token.find(c)) != string::npos) {
                if (!token.substr(0, pos).empty()) {
                    boredom_count += starts_with_i(token.substr(0, pos));
                }
                token.erase(0, pos + 1);
            }
        }

        // Check the remaining part of the sentence
        if (!token.empty()) {
            boredom_count += starts_with_i(token);
        }
    }

    return boredom_count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_bored("Hello world") == 0);
    assert (is_bored("Is the sky blue?") == 0);
    assert (is_bored("I love It !") == 1);
    assert (is_bored("bIt") == 0);
    assert (is_bored("I feel good today. I will be productive. will kill It") == 2);
    assert (is_bored("You and I are going for a walk") == 0);
}

