    vector<string> sentences;
    stringstream ss(input);
    string token;

    while (getline(ss, token, '.')) {
        size_t pos = 0;
        while ((pos = token.find_first_of(delimiters, pos)) != string::npos) {
            string sentence = token.substr(0, pos).substr(token.substr(0, pos).find_last_not_of(" ") + 1);
            if (!sentence.empty()) sentences.push_back(sentence);
            token.erase(0, pos + 1);
        }
        if (!token.empty()) sentences.push_back(token);
    }

    return sentences;
}

int is_bored(string S) {
    const char* delimiters = ".?!";
    vector<string> sentences = split_sentences(S, delimiters);

    int boredom_count = 0;
    for (const auto& sentence : sentences) {
        if (starts_with_i(sentence)) ++boredom_count;
    }

    return boredom_count;
}

