bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) return false;

    bool lower_case = false;
    bool upper_case = false;

    for (const auto& pair : dict) {
        const string& key = pair.first;

        // Check if the key is entirely lowercase or uppercase
        bool all_lower = true, all_upper = true;
        for (char c : key) {
            if (!islower(c)) all_lower = false;
            if (!isupper(c)) all_upper = false;
        }

        if (all_lower && !all_upper) lower_case = true;
        else if (!all_lower && all_upper) upper_case = true;
        else return false; // Mixed case or invalid key

        // If both lower and upper cases are found, return false
        if (lower_case && upper_case) return false;
    }

    // Return true if either all keys are lowercase or uppercase
    return lower_case || upper_case;
}

