// Function to encode a string by shifting every character by 5 in the alphabet.
string encode_shift(string s) {
    string out;
    int i;
    for (i = 0; i < s.length(); i++) {
        // Shift each character by 5 positions within the range of 'a' to 'z'
        int w = ((int)s[i] + 5 - (int)'a') % 26 + (int)'a';
        out += (char)w;
    }
    return out;
}

// Function to decode a string that was encoded with encode_shift function.
string decode_shift(string s) {
    string out;
    int i;
    for (i = 0; i < s.length(); i++) {
        // Reverse the shift by moving backward by 5 positions within the range of 'a' to 'z'
        int w = ((int)s[i] - (int)'a' - 5 + 26) % 26 + (int)'a';
        out += (char)w;
    }
    return out;
}

