int sum_of_digits(int n) {
    int sum = 0;
    while (n != 0) {
        sum += abs(n % 10);
        n /= 10;
    }
    return sum * (abs(n) == -n ? -1 : 1); // Adjust for negative numbers
}

bool compare(const pair<int, int>& a, const pair<int, int>& b) {
    if (sum_of_digits(a.first) != sum_of_digits(b.first)) {
        return sum_of_digits(a.first) < sum_of_digits(b.first);
    }
    return a.second < b.second;
}

vector<int> order_by_points(vector<int> nums) {
    vector<pair<int, int>> indexed_nums;

    // Pair each number with its index
    for (int i = 0; i < nums.size(); ++i) {
        indexed_nums.push_back({nums[i], i});
    }

    // Sort based on the sum of digits and then by original index if sums are equal.
    sort(indexed_nums.begin(), indexed_nums.end(), compare);

    vector<int> sorted_nums;
    for (const auto& p : indexed_nums) {
        sorted_nums.push_back(p.first);
    }

    return sorted_nums;
}


