using namespace std;

int sum_of_digits(int n) {
    int sum = 0;
    bool is_negative = n < 0;
    while (n != 0) {
        sum += n % 10;
        n /= 10;
    }
    return is_negative ? -sum : sum;
}

struct CustomComparator {
    vector<int>& nums;
    explicit CustomComparator(vector<int>& nums) : nums(nums) {}

    bool operator()(int a, int b) {
        int sum_a = sum_of_digits(a);
        int sum_b = sum_of_digits(b);

        if (sum_a != sum_b) return sum_a < sum_b;

        // If sums are equal, compare based on original index
        auto it_a = find(nums.begin(), nums.end(), a);
        auto it_b = find(nums.begin(), nums.end(), b);
        return distance(nums.begin(), it_a) < distance(nums.begin(), it_b);
    }
};

vector<int> order_by_points(vector<int> nums) {
    CustomComparator comp(nums);
    sort(nums.begin(), nums.end(), comp);
    return nums;
}

