bool simplify(string x, string n) {
    int num1, den1, num2, den2;

    // Extracting numerator and denominator from the fractions.
    size_t slashPos = x.find('/');
    stringstream(x.substr(0, slashPos)) >> num1;
    stringstream(x.substr(slashPos + 1)) >> den1;

    slashPos = n.find('/');
    stringstream(n.substr(0, slashPos)) >> num2;
