float median(vector<float> l) {
    sort(l.begin(), l.end());
    int n = l.size();
    if (n % 2 == 1) {
        return l[n / 2];
    } else {
        float mid_index = n / 2;
        return (l[mid_index - 1] + l[mid_index]) / 2.0;
    }
}

