vector<string> words_string(string s) {
    // Replace all commas with spaces.
    for (size_t pos = 0; (pos = s.find(',')) != string::npos;) {
        s.replace(pos, 1, " ");
    }

    vector<string> result;
    stringstream ss(s);
    string word;

    // Split the modified string by spaces and store in a vector.
    while (ss >> word) {
        result.push_back(word);
    }

    return result;
}

