using namespace std;

bool move_one_ball(vector<int> arr) {
    // Check if the array is empty
    if (arr.empty()) return true;

    int n = arr.size();
    bool found_split_point = false;
    int split_index = -1;

    // Find a potential split point where the order breaks
    for (int i = 0; i < n - 1; ++i) {
        if (arr[i] > arr[i + 1]) {
            if (!found_split_point) {
                found_split_point = true;
                split_index = i;
            } else {
                // More than one break point, cannot be sorted by rotation
                return false;
            }
        }
    }

    // If no split point is found, the array is already sorted
    if (!found_split_point) return true;

    // Check if the last element is less than or equal to the first element
    if (arr[n - 1] > arr[0]) {
        return false;
    }

    // Verify that all elements after the split point are in non-decreasing order
    for (int i = split_index + 1; i < n - 1; ++i) {
        if (arr[i] > arr[i + 1]) {
            return false;
        }
    }

    return true;
}

