bool move_one_ball(vector<int> arr) {
    // Check if array is empty or already sorted.
    if (arr.empty() || is_sorted(arr.begin(), arr.end())) {
        return true;
    }

    int n = arr.size();

    // Find the index where order breaks
    for (int i = 0; i < n - 1; ++i) {
        if (arr[i] > arr[i + 1]) {
            // Construct shifted array by performing right shift operation.
            vector<int> shifted_arr(arr.begin() + i + 1, arr.end());
            shifted_arr.insert(shifted_arr.end(), arr.begin(), arr.begin() + i + 1);

            // Check if the new array is sorted
            return is_sorted(shifted_arr.begin(), shifted_arr.end());
        }
    }

    // If no break point found and not already returned true, return false.
    return false;
}

