map<char, int> histogram(string test) {
    map<char, int> counts;

    if (test.empty()) return counts; // Return empty map for empty input

    stringstream ss(test);
    string word;

    while (ss >> word) {  // Count occurrences of each character
        char ch = word[0];
        counts[ch]++;
    }

    if (counts.empty()) return counts; // Handle case where no characters are present

    int max_count = 0;
    for (const auto& pair : counts) {
        max_count = max(max_count, pair.second); // Find the maximum count
    }

    map<char, int> result;

    for (const auto& pair : counts) { // Filter characters that have the maximum count
        if (pair.second == max_count) {
            result.insert(pair);
        }
    }

    return result;
}

